import React, { Fragment } from 'react'

const MeatRelease = (props) => {
    let boolvar = false;

    const checked = () => {
        boolvar = true
    }
    return (
        <Fragment>
            <input type="checkbox" id="checkbox" onClick={checked} />
            {boolvar && <button className='continue-btn' onClick={props.changeToTestPage} >
                Continue
            </button>}
        </Fragment>
    )
}

export default MeatRelease
